@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:CashCard a owl:Class .
atm:ATM a owl:Class .
atm:InitialDisplay a owl:Class .

atm:hasCashCard a owl:ObjectProperty ;
    rdf:domain atm:ATM ;
    rdf:range atm:CashCard .

atm:display a owl:ObjectProperty ;
    rdf:domain atm:ATM ;
    rdf:range atm:InitialDisplay .

atm:NoCashCardInATM a owl:Class ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:hasCashCard ;
                          owl:cardinality "0"^^xsd:nonNegativeInteger ] .

atm:ShouldDisplayInitialDisplay a owl:Class ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:display ;
                          owl:someValuesFrom atm:InitialDisplay ] .

atm:NoCashCardInATM owl:equivalentClass atm:ShouldDisplayInitialDisplay .
